  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset provides monthly data at the
  national level from federal fiscal year 2008 - 2011 of Social Security Retirement
  Insurance applications filed via the Internet, and Social Security Retirement Insurance
  applications submitted via telephone, in person through a local SSA field office,
  or by mail that could be filed via the Internet.  Percentage of online applications
  is derived by dividing the number of retirement insurance applications filed via
  the Internet by the total number of retirement insurance applications that could
  be filed via the Internet.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
